INSERT INTO `wcc_wc_admin_notes` VALUES("1", "wc-admin-onboarding-email-marketing", "info", "en_US", "Tips, product updates, and inspiration", "We\'re here for you - get tips, product updates and inspiration straight to your email box", "{}", "unactioned", "woocommerce-admin", "2021-01-09 09:41:12", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("2", "wc-admin-marketing-intro", "info", "en_US", "Connect with your audience", "Grow your customer base and increase your sales with marketing tools built for WooCommerce.", "{}", "unactioned", "woocommerce-admin", "2021-01-09 09:41:12", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("3", "ecomm-need-help-setting-up-your-store", "info", "en_US", "Need help setting up your Store?", "Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:15", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("4", "woocommerce-services", "info", "en_US", "WooCommerce Shipping & Tax", "WooCommerce Shipping &amp; Tax helps get your store “ready to sell” as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("5", "ecomm-unique-shopping-experience", "info", "en_US", "For a shopping experience as unique as your customers", "Product Add-Ons allow your customers to personalize products while they’re shopping on your online store. No more follow-up email requests—customers get what they want, before they’re done checking out. Learn more about this extension that comes included in your plan.", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("6", "wcpay-promo-2020-11", "marketing", "en_US", "Manage subscriber payments from your store\'s dashboard", "Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("7", "wcpay-subscriptions-2020-11", "marketing", "en_US", "Manage subscriber payments from your store\'s dashboard", "Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("8", "wcpay-promo-2020-12", "marketing", "en_US", "Get 50% off transaction fees with WooCommerce Payments", "Keep more of your hard-earned cash by adding <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">WooCommerce Payments</a> to your store. Lock in a discounted rate of 1.5% + $0.15 for $25,000 of payments (or three months, whichever comes first). Limited time offer – don’t miss out! <br /><br /><em>By clicking \"Install now,\" you agree to our promotional <a href=\"https://woocommerce.com/terms-conditions/woocommerce-payments-promotion/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_exp20\" target=\"_blank\">Terms of Service</a>.</em>", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("9", "wcpay-subscriptions-2020-12", "marketing", "en_US", "Manage payments from your store\'s dashboard", "Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>", "{}", "pending", "woocommerce.com", "2021-01-09 09:41:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("10", "wc-admin-wc-helper-connection", "info", "en_US", "Connect to WooCommerce.com", "Connect to get important product notifications and updates.", "{}", "unactioned", "woocommerce-admin", "2021-01-09 09:41:17", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("11", "wc-admin-orders-milestone", "info", "en_US", "First order received", "Congratulations on getting your first order! Now is a great time to learn how to manage your orders.", "{}", "unactioned", "woocommerce-admin", "2021-01-10 08:59:57", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("12", "wc-admin-coupon-page-moved", "update", "en_US", "Coupon management has moved!", "Coupons can now be managed from Marketing &gt; Coupons. Click the button below to remove the legacy WooCommerce &gt; Coupons menu item.", "{}", "unactioned", "woocommerce-admin", "2021-01-11 09:32:10", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("13", "wc-admin-new-sales-record", "info", "en_US", "New sales record!", "Woohoo, January 10th was your record day for sales! Net Sales was £442.00 beating the previous record of £410.00 set on January 9th.", "{\"old_record_date\":\"2021-01-09\",\"old_record_amt\":410,\"new_record_date\":\"2021-01-10\",\"new_record_amt\":442}", "unactioned", "woocommerce-admin", "2021-01-11 09:41:38", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("14", "wc-admin-mobile-app", "info", "en_US", "Install Woo mobile app", "Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.", "{}", "unactioned", "woocommerce-admin", "2021-01-11 09:41:38", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("15", "wc-admin-usage-tracking-opt-in", "info", "en_US", "Help WooCommerce improve with usage tracking", "Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"https://wordpressecommerce001.000webhostapp.com/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.", "{}", "unactioned", "woocommerce-admin", "2021-01-18 06:55:58", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("16", "wc-admin-store-notice-giving-feedback-2", "info", "en_US", "Give feedback", "Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.", "{}", "unactioned", "woocommerce-admin", "2021-01-18 06:55:58", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("17", "wc-admin-insight-first-sale", "survey", "en_US", "Did you know?", "A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?", "{}", "unactioned", "woocommerce-admin", "2021-01-18 06:55:59", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("18", "wc-admin-home-screen-feedback", "info", "en_US", "Help us improve the WooCommerce Home screen", "We\'d love your input to shape the future of the WooCommerce Home screen together. Feel free to share any feedback, ideas or suggestions that you have.", "{}", "unactioned", "woocommerce-admin", "2021-01-21 09:51:02", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("19", "your-first-product", "info", "en_US", "Your first product", "That\'s huge! You\'re well on your way to building a successful online store — now it’s time to think about how you\'ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.", "{}", "pending", "woocommerce.com", "2021-01-24 11:29:58", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("20", "wc-admin-getting-started-in-ecommerce", "info", "en_US", "Getting Started in eCommerce - webinar", "We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.", "{}", "pending", "woocommerce.com", "2021-01-27 10:01:16", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("21", "facebook_pixel_api_2021", "marketing", "en_US", "Improve the performance of your Facebook ads", "Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved performance and measurement of your Facebook ad campaigns.", "{}", "pending", "woocommerce.com", "2021-03-14 11:21:49", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("22", "facebook_ec_2021", "marketing", "en_US", "Sync your product catalog with Facebook to help boost sales", "A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.", "{}", "pending", "woocommerce.com", "2021-03-14 11:21:49", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("23", "wc-square-apple-pay-boost-sales", "marketing", "en_US", "Boost sales with Apple Pay", "Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.", "{}", "pending", "woocommerce.com", "2021-03-14 11:21:49", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("24", "wc-square-apple-pay-grow-your-business", "marketing", "en_US", "Grow your business with Square and Apple Pay ", "Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.", "{}", "pending", "woocommerce.com", "2021-03-14 11:21:49", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("25", "wc-admin-optimizing-the-checkout-flow", "info", "en_US", "Optimizing the checkout flow", "It\'s crucial to get your store\'s checkout as smooth as possible to avoid losing sales. Let\'s take a look at how you can optimize the checkout experience for your shoppers.", "{}", "pending", "woocommerce.com", "2021-03-14 11:21:49", NULL, "0", "plain", "", "0", "info");
INSERT INTO `wcc_wc_admin_notes` VALUES("26", "wc-admin-first-five-things-to-customize", "info", "en_US", "The first 5 things to customize in your store", "Deciding what to start with first is tricky. To help you properly prioritize, we\'ve put together this short list of the first few things you should customize in WooCommerce.", "{}", "unactioned", "woocommerce.com", "2021-03-14 11:21:49", NULL, "0", "plain", "", "0", "info");
